 "class": "HTMLText",
 "backgroundOpacity": 0,
 "paddingBottom": 20,
 "borderRadius": 0,
 "shadow": false,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#cccccc;font-size:14px;font-family:Tahoma, Geneva, sans-serif;\"><B>Proyecto - Casa de la Memoria de la Costa Pac\u00edfica Nari\u00f1ense.</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#cccccc;font-size:14px;font-family:Tahoma, Geneva, sans-serif;\">La Casa de Memoria de la Costa Pac\u00edfica Nari\u00f1ense, Ubicado en el casco urbano del municipio de Tumaco. es una iniciativa comunitaria impulsada por la Di\u00f3cesis de Tumaco que aborda, a trav\u00e9s de estrategias museogr\u00e1ficas y pedag\u00f3gicas, la problem\u00e1tica del conflicto armado, la construcci\u00f3n de una cultura de paz y el reconocimiento de las v\u00edctimas en Colombia. Adem\u00e1s del museo, el cual est\u00e1 inscrito en el Sistema de Informaci\u00f3n de Museos Colombianos (SIMCO), desarrollamos varias iniciativas pedag\u00f3gicas con docentes, v\u00edctimas, j\u00f3venes, ni\u00f1as y ni\u00f1os. Tiene como misi\u00f3n educar para la Paz y la transformaci\u00f3n social rescatado tambi\u00e9n las tradiciones culturales que han sido y representan las fortalezas de la comunidad y su resiliencia durante los a\u00f1os del conflicto armado. A trav\u00e9s de actos simb\u00f3licos y celebraciones esta iniciativa ha contribuido al reconocimiento de la memoria de los l\u00edderes asesinados en esta regi\u00f3n. Finalmente, los ejercicios de memoria que se apoyan y fortalecen mediante la Casa de la Memoria han contribuido tambi\u00e9n a reconocer nuestra responsabilidad sobre lo que sucedi\u00f3 en pro de la reconciliaci\u00f3n.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#cccccc;font-size:14px;font-family:Tahoma, Geneva, sans-serif;\">Durante los diez a\u00f1os de funcionamiento ha recibido varios premios por su labor, entre ellos el Premio Franco-alem\u00e1n de Derechos Humanos Antonio Nari\u00f1o y el premio del Centro Nacional de Memoria Hist\u00f3rica (CNMH) como mejor exposici\u00f3n museogr\u00e1fica de memoria del conflicto armado. </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
